const LogoutButton = () => {
    useEffect(() => {
        fetch('http://localhost:8080/api/v1/Users/110', { method: 'DELETE' })
            .then(() => {console.log("user deleted")});
    
    }, []);
     const {logout} = useAuth0();
    return (
        <Button
            onClick={()=>logout()}
            id = "qsLogoutBtn"
            variant = "danger"
            className = "btn-margin"
        >
            Log Out
        </Button>    
    );
};

export default LogoutButton;
